  return (
    <div className="section">
      <div className="newsletter">
        <div className="newsltter__title">Newsletter</div>
        <div className="newsletter__offer">
          Receive special offers and first look at new products.
        </div>
        <div className="newsletter__container__email">
          <form className="newsletter__container__email__form">
            <input
              type="text"
              name="query"
              value={query}
              id="search-input"
              placeholder="write something"
              onChange={handleOnInputChange}
            ></input>

            <div className="newsletter__container__email__button">
              Subscribe
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Newsletter;
